const int N=405;
int s[N],T,n,m,mod;
void decode(){
	int i,j,l=strlen(ops),g,w;
	for(i=0,m=-1;i<l;i++){
		if(ops[i]==126||ops[i]==125){
			if(m>=0)s[m]=w;++m;
			g=1,w=0;
			if(ops[i]==126)g=mod-g;
		}else{
			w=(w+(i64)g*(ops[i]-33))%mod;
			g=(i64)g*92%mod;
		}
	}
	s[m]=w;
	for(i=m;i>=0;i--)for(j=i+1;j<=m;j++)s[j]=(s[j]+(i64)s[j-1]*(j-i))%mod;
	for(i=1;i<=m;i++)s[i]=(s[i]+(i64)s[i-1]*i)%mod;
}
int main(){
	for(scanf("%d%d",&T,&mod),decode();T;--T){
		scanf("%d",&n),printf("%d\n",n==2?2:s[n-1]);
	}
}